import React from "react";
import { Card, Table } from "react-bootstrap";
// import './App.css'; // Make sure to include the CSS for highlighting

const inventoryData = [
  { foodItem: "Rice ðŸš", bestUseBefore: "2023-12-31", quantityLeft: "20kg (Low)" },
  { foodItem: "Vegetables ðŸ¥¦ðŸ¥•", bestUseBefore: "2023-11-15", quantityLeft: "50kg" },
  { foodItem: "Spices ðŸŒ¶ï¸", bestUseBefore: "2024-01-10", quantityLeft: "10kg" },
  { foodItem: "Bread ðŸž", bestUseBefore: "2023-10-20", quantityLeft: "15kg" },
  { foodItem: "Milk ðŸ¥›", bestUseBefore: "2023-10-15", quantityLeft: "30L" },
  { foodItem: "Eggs ðŸ¥š", bestUseBefore: "2023-10-05", quantityLeft: "200 units" },
  { foodItem: "Chicken ðŸ—", bestUseBefore: "2023-10-03", quantityLeft: "25kg" },
  { foodItem: "Fish ðŸŸ", bestUseBefore: "2023-10-02", quantityLeft: "18kg" },
  { foodItem: "Pasta ðŸ", bestUseBefore: "2023-12-01", quantityLeft: "40kg" },
  { foodItem: "Tomatoes ðŸ…", bestUseBefore: "2023-09-30", quantityLeft: "22kg" },
  { foodItem: "Onions ðŸ§…", bestUseBefore: "2023-10-15", quantityLeft: "35kg" },
  { foodItem: "Potatoes ðŸ¥”", bestUseBefore: "2023-11-20", quantityLeft: "60kg" },
  { foodItem: "Cheese ðŸ§€", bestUseBefore: "2023-10-20", quantityLeft: "10kg" },
  { foodItem: "Yogurt ðŸ¥„", bestUseBefore: "2023-10-07", quantityLeft: "25kg" },
  { foodItem: "Butter ðŸ§ˆ", bestUseBefore: "2023-10-12", quantityLeft: "15kg" },
  { foodItem: "Apples ðŸŽ", bestUseBefore: "2023-10-18", quantityLeft: "30kg" },
  { foodItem: "Bananas ðŸŒ", bestUseBefore: "2023-10-05", quantityLeft: "25kg" },
  { foodItem: "Oranges ðŸŠ", bestUseBefore: "2023-10-15", quantityLeft: "20kg" },
  { foodItem: "Grapes ðŸ‡", bestUseBefore: "2023-10-08", quantityLeft: "15kg" },
  { foodItem: "Lettuce ðŸ¥¬", bestUseBefore: "2023-10-04", quantityLeft: "10kg" },
  { foodItem: "Peppers ðŸŒ¶ï¸", bestUseBefore: "2023-10-10", quantityLeft: "12kg" },
  { foodItem: "Cucumbers ðŸ¥’", bestUseBefore: "2023-10-10", quantityLeft: "14kg" },
  { foodItem: "Carrots ðŸ¥•", bestUseBefore: "2023-10-12", quantityLeft: "18kg" },
  { foodItem: "Spinach ðŸƒ", bestUseBefore: "2023-10-03", quantityLeft: "12kg" },
  { foodItem: "Beans ðŸ«˜", bestUseBefore: "2023-10-20", quantityLeft: "20kg" },
  { foodItem: "Lentils ðŸ›", bestUseBefore: "2023-12-20", quantityLeft: "15kg" },
  { foodItem: "Beef ðŸ¥©", bestUseBefore: "2023-10-05", quantityLeft: "25kg" },
  { foodItem: "Pork ðŸ–", bestUseBefore: "2023-10-07", quantityLeft: "20kg" },
  { foodItem: "Tofu ðŸ¥£", bestUseBefore: "2023-10-09", quantityLeft: "10kg" },
  { foodItem: "Peas ðŸŸ¢", bestUseBefore: "2023-11-11", quantityLeft: "30kg" },
];

function findNearestDate(data) {
  const today = new Date();
  const nearestDate = data.reduce((nearest, item) => {
    const itemDate = new Date(item.bestUseBefore);
    return itemDate < nearest ? itemDate : nearest;
  }, new Date('2023-'));
  return nearestDate.toISOString().split('T')[0];
}

function InventoryManagement() {
  const nearestDate = findNearestDate(inventoryData);

  return (
    <div className="fade-in p-4" style={{ backgroundColor: 'var(--primary-light)', borderRadius: '8px' }}>
      <h2>Inventory Management</h2>
      <Card className="p-3">
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Food Item</th>
              <th>Best Use Before</th>
              <th>Quantity Left</th>
            </tr>
          </thead>
          <tbody>
            {inventoryData.map((item, index) => (
              <tr key={index} className={item.bestUseBefore === nearestDate ? 'highlight' : ''}>
                <td>{item.foodItem}</td>
                <td>{item.bestUseBefore}</td>
                <td>{item.quantityLeft}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      </Card>
    </div>
  );
}

export default InventoryManagement;
